import React from 'react';

function App() {
    return(
     <ul>
        <li>The sum of two number is :{add(22,2)}</li>
        <li>The sub of two number is :{sub(22,2)}</li>
        <li>The mul of two number is :{mul(22,2)}</li>
        <li>The devide of two number is :{div(22,3)}</li>
     </ul>
    );
}

export default App;
